bool ans[MAX_N];
int ret = 0;

int main() {
	ios_base::sync_with_stdio(false); std::cin.tie(NULL);

	for (int i = 2; i <= sqrt(MAX_N); i++) {
			if (!isnPrime[i])
				for (int j = i * 2; j < MAX_N; j += i)
					isnPrime[j] = true;
		}
	for (int i = 2; i < MAX_N; i++)
		if (!isnPrime[i])
			primes.emplace_back(i);
		
	cin >> k;
	for (int i = 0; i < 1645; i++) 
		if (arr[i] >= k) {
			minValue = 1000000 * i;
			maxValue = minValue + 1000000;
			if (i)
				k -= arr[i - 1];
			break;
		}

	for (ll e : primes) {
		ll t = (minValue + (e * e - 1)) / (e * e) * (e * e);

		while (t <= maxValue) {
			ans[t - minValue] = true;
			t += e * e;
		}
	}
	for (int i = 0; i <= maxValue - minValue; i++) {
		if (!ans[i])
			ret++;
		if (ret == k) {
			cout << minValue + i << endl;
			break;
		}
	}


	return 0;
}